const Box = () => {
    return (
        <div style={{ width: '300px', height: '300px' }}>
            <div>
                <label>아이디</label>
                <input></input>
            </div>
            <div>
                <label>비밀번호</label>
                <input></input>
            </div>
            <button>로그인</button>
        </div>
    );
};

export default Box;
